"use client";

import { useState } from "react";
import Link from "next/link";
import { usePathname } from "next/navigation";
import { Search, User, ShoppingCart, Globe } from "lucide-react";
import { Button } from "@/components/ui/button";
import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuItem,
  DropdownMenuTrigger,
} from "@/components/ui/dropdown-menu";
import { useLanguage } from "@/context/language-context";

export function Navbar() {
  const [cartItems, setCartItems] = useState(0);
  const { language, setLanguage, t } = useLanguage();
  const pathname = usePathname();

  const activeClass = (path: string) =>
    pathname === path
      ? "underline underline-offset-[6px] rounded text-pri-blue font-bold"
      : "border-transparent text-pri hover:text-pri-light hover:border-pri-light";

  return (
    <nav className="m-2">
      <div className="container px-4 mx-auto">
        <div className="flex items-center h-16">
          {/* Left Navigation Links */}
          <div className="flex items-center flex-1">
            <div className="flex items-center gap-4">
              <Link
                href="/"
                className={`px-3 py-2 font-serif text-md transition-colors ${activeClass(
                  "/"
                )}`}
              >
                {t.nav.home}
              </Link>
              <Link
                href="/products"
                className={`px-3 py-2 text-md font-serif transition-colors  ${activeClass(
                  "/products"
                )}`}
              >
                {t.nav.products}
              </Link>
              <Link
                href="/special-offers"
                className={`px-3 py-2 text-md font-serif transition-colors  ${activeClass(
                  "/special-offers"
                )}`}
              >
                {t.nav.offers}
              </Link>
              <Link
                href="/contact"
                className={`px-3 py-2 text-md font-serif transition-colors  ${activeClass(
                  "/contact"
                )}`}
              >
                {t.nav.contact}
              </Link>
            </div>
          </div>

          {/* Centered Logo */}
          <Link href="/" className="flex justify-center flex-1">
            <svg
              width="64"
              height="64"
              viewBox="0 0 64 64"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              xmlnsXlink="http://www.w3.org/1999/xlink"
            >
              <rect width="64" height="64" fill="url(#pattern0_119_31)" />
              <defs>
                <pattern
                  id="pattern0_119_31"
                  patternContentUnits="objectBoundingBox"
                  width="1"
                  height="1"
                >
                  <use
                    xlinkHref="#image0_119_31"
                    transform="scale(0.00104167)"
                  />
                </pattern>
                <image
                  id="image0_119_31"
                  width="960"
                  height="960"
                  xlinkHref="data:image/png;base64,"
                />
              </defs>
            </svg>
          </Link>

          {/* Right Icons Section */}
          <div className="flex items-center justify-end flex-1 gap-4">
            <DropdownMenu>
              <DropdownMenuTrigger asChild>
                <Button variant="ghost" size="icon" className="text-pri">
                  <Globe className="w-6 h-6" />
                </Button>
              </DropdownMenuTrigger>
              <DropdownMenuContent align={language === "ar" ? "end" : "start"}>
                <DropdownMenuItem onClick={() => setLanguage("ar")}>
                  
                </DropdownMenuItem>
                <DropdownMenuItem onClick={() => setLanguage("en")}>
                  English
                </DropdownMenuItem>
              </DropdownMenuContent>
            </DropdownMenu>

            <Button variant="ghost" size="icon" className="relative text-pri">
              <ShoppingCart className="w-6 h-6" />
              {cartItems > 0 && (
                <span className="absolute top-0 right-0 flex items-center justify-center w-4 h-4 text-xs text-white rounded-full bg-secondary-pink">
                  {cartItems}
                </span>
              )}
            </Button>

            <DropdownMenu>
              <DropdownMenuTrigger asChild>
                <Button variant="ghost" size="icon" className="text-pri">
                  <User className="w-6 h-6" />
                </Button>
              </DropdownMenuTrigger>
              <DropdownMenuContent align={language === "ar" ? "end" : "start"}>
                <DropdownMenuItem>{t.account.login}</DropdownMenuItem>
                <DropdownMenuItem>{t.account.register}</DropdownMenuItem>
              </DropdownMenuContent>
            </DropdownMenu>

            <div className="relative">
              <input
                type="text"
                placeholder={language === "ar" ? "" : "Search"}
                className="px-4 py-2 pr-10 bg-pri-beige  rounded-full focus:outline-none border border-transparent focus:border-primary"
              />
              <Search className="absolute right-3 top-2.5 h-5 w-5 text-gray-400" />
            </div>
          </div>
        </div>
      </div>
      <div className="border-b-2 border-#4E031154 mx-24"></div>
    </nav>
  );
}
